  set selectedColumns(val: any[]) {
    this._selectedColumns = this.displayedColumns.filter(col => val.includes(col));
  }

  SearchProductsBranch() {
    this.productBranchFilters.idBranchOffice = this._Authservice.currentOffice;;

    this.loading = true;
    this.loadingService.startLoading('wait_loading');
    this._productbranchofficeservice.getProductBranchOfficebyfilter(this.productBranchFilters).subscribe((data: PackingByBranchOffice[]) => {
      var productbranchpacking: PackingByBranchOffice[] = [];
      data = data.sort((a, b) => new Date(b.createDate).getTime() - new Date(a.createDate).getTime());
      data.forEach(productbranch => {
        if (productbranchpacking.length == 0 && productbranch.packingType.id == 2) {
          data.filter(x => x.idProduct == productbranch.idProduct).forEach(element => { productbranch.totalavailable = productbranch.totalavailable == undefined ? element.available : productbranch.totalavailable + element.available });
          productbranchpacking.push(productbranch)
        } else {
          if (productbranchpacking.filter(x => x.idProduct == productbranch.idProduct).length == 0 && productbranch.packingType.id == 2) {
            data.filter(x => x.idProduct == productbranch.idProduct).forEach(element => { productbranch.totalavailable = productbranch.totalavailable == undefined ? element.available : productbranch.totalavailable + element.available });
            productbranchpacking.push(productbranch)
          }
        }
      });
      this.productBranchList = productbranchpacking;
      this.productBranchListDB = data;
      //this.updateRowGroupMetaData();
      this.loadingService.stopLoading();
      this.loading = false;
    }, (error: HttpErrorResponse) => {
      this.loadingService.stopLoading();
      this.loading = false;
      this.messageService.add({ severity: 'error', summary: 'Error', detail: "Ha ocurrido un error cargando los productos por sucursal" });
    });
  }

  getPackings(idProduct: number) {
    return this.productBranchListDB.filter(x => x.idProduct === idProduct).sort((a, b) => a.units - b.units);;
  }

  changeStatusProduct(product: PackingByBranchOffice) {
    this.idproduct = product.idProduct;
    this.idBranchOffice = product.idBranchOffice;
    this.productPackingModel = product;
    this.productPackingModel.idStatus = product.product.status.id == 1 ? 2 : 1;
    this.productPackingModel.description = "";
    if (product.product.status.id == 1) {
      this.idModule = 135;
      this.showDialogReason = true;
    } else {
      this.saveStatusPacking();
    }

  }

  saveStatusPacking() {
    var packingBranchOfficelist: PackingByBranchOffice[] = [];
    this.productPackingModel.idProduct = parseInt(this.idproduct.toString());
    this.productPackingModel.idPacking = this.productPackingModel.idPacking;
    this.productPackingModel.idBranchOffice = parseInt(this.idBranchOffice.toString());
    this.productPackingModel.idSuplier = this.productPackingModel.idSuplier == -1 ? 0 : this.productPackingModel.idSuplier;
    this.productPackingModel.idStatus = this.productPackingModel.idStatus == -1 ? 1 : this.productPackingModel.idStatus;
    packingBranchOfficelist.push(this.productPackingModel);
    this._productbranchofficeservice.postPackingBranchOffice(packingBranchOfficelist).subscribe((data) => {
      if (data > 0) {
        this.messageService.add({ severity: 'success', summary: 'Guardado', detail: "Guardado exitoso" });
        this.SearchProductsBranch();
      } else {
        this.messageService.add({ severity: 'error', summary: 'Error', detail: "Ha ocurrido un error al cambiar el estatus del empaque" });
      }
    }, (error) => {
      console.log(error);
    });
  }

  refreshPackingBranchOffices() {
    this.SearchProductsBranch();
  }

  openNew = () => {
    const queryParams: any = {};
    queryParams.productcatalogfilters = JSON.stringify([]);
    const navigationExtras: NavigationExtras = {
      queryParams
    };
    this.router.navigate(['mpc/productgeneralsection', 0, 0, 0], { state: navigationExtras });
  }

  onViewPackingProduct(product: PackingByBranchOffice) {
    this.indtabsactive = 1;
    this.productPackingModel = product;
    this.showExpressTab = true;
  }

  onViewProduct(product: PackingByBranchOffice) {
    this.indtabsactive = 0;
    this.productPackingModel = product;
    this.showExpressTab = true;
  }

  searchCoinsxCompany() {
    var filter = new CoinxCompanyFilter();
    filter.idCompany = 1;
    this.coinsService.getCoinxCompanyList(filter).subscribe((data: Coins[]) => {
      data.forEach(coin => {
        if (coin.legalCurrency == true) {
          this.basesymbolcoin = coin.symbology;
        } else {
          this.conversionsymbolcoin = coin.symbology;
        }
      });
    })
  }

